#pragma objc_language_version(3)
#ifndef __OBJC3_FEATURE_NULLABILITY_REPLAY_DETERMINISM__
#define __OBJC3_FEATURE_NULLABILITY_REPLAY_DETERMINISM__ 1
#endif

typedef struct M10A010_Probe {
    int enabled;
    int sequence;
    int issue;
} M10A010_Probe;

M10A010_Probe m10a010_probe(void) {
#if __OBJC3_FEATURE_NULLABILITY_REPLAY_DETERMINISM__
    M10A010_Probe probe = { 1, 10, 1625 };
#else
    M10A010_Probe probe = { 0, 10, 1625 };
#endif
    return probe;
}
